import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notes from '../notes';

function App(){
    return (
    <div>
        <Header />
        {notes.map(x=>{
            return(
                <Note
                    key={x.key}
                    title={x.title}
                    content={x.content}
                />
            );
        })};
        <Footer /> 
    </div>
    );
}

export default App;
